import React from 'react';
import { FooterContainer } from './styled';

const Footer: React.FC = () => {
  return (
    <FooterContainer>
      <p>
        Developed By <a href="https://www.ehsanazizi.me">Ehsan Azizi</a>
      </p>
    </FooterContainer>
  );
};

export default Footer;
